const Konekto = require("konekto");
const user = "agens";
const password = "agens";
const host = "localhost";
const port = 5432;
const database = "agens";
const konekto = new Konekto( `postgresql://${user}:${password}@${host}:${port}/${database}`
);
async function run() { // connecting to the database await konekto.connect(); const json = { _label: "xd", some_prop: "lul", some_relationship: { _label: "omegalul", other_prop: 1 } }; // creating some basic schema await konekto.createSchema(json); // inserting data const id = await konekto.save(json); json._id = id; json.more_prop = true; // adding more properties json.some_prop = undefined; // removing properties // updating data in the database await konekto.save(json); // querying const jsonDb = await konekto.findById(id); jsonDb.some_relationship.other_prop = 1.5; // updating related data await konekto.save(jsonDb.some_relationship); // delete data await konekto.deleteById(id); // when deleting by id, you delete individual jsons, not the whole graph const relatedJsonDb = await konekto.findById(jsonDb.some_relationship._id); relatedJsonDb !== undefined && relatedJsonDb.other_prop === jsonDb.some_relationship; // true
}
run();
